function ExplanationsSection() {
  return (
    <div className="explanationsSection">
      <div className="explanation">
        <div className="attribution">
          <img className="attribution-avatar" src="https://pbs.twimg.com/profile_images/822547732376207360/5g0FC8XX.jpg" />
          <p className="attribution-username"></p>
        </div>
      </div>
    </div>
  )
}

export default ExplanationsSection
